using System;\nusing System.Diagnostics;\n\nclass Program\n{\n    static void Main()\n    {\n        ProcessStartInfo start = new ProcessStartInfo();\n        start.FileName = "java.exe"; // Path to java.exe if not in PATH\n        start.Arguments = "-Xmx1024m -cp \"./../libs/*;l2jserver.jar\" net.sf.l2j.gameserver.GameServer";\n        start.UseShellExecute = false;\n        start.RedirectStandardOutput = true;\n\n        using (Process process = Process.Start(start))\n        {\n            using (System.IO.StreamReader reader = process.StandardOutput)\n            {\n                string result = reader.ReadToEnd();\n                Console.WriteLine(result); // Here you can replace with code to write to a textbox\n            }\n            process.WaitForExit();\n        }\n    }\n}